webpackJsonp([30381927370718],{350:function(n,s){n.exports={data:{site:{siteMetadata:{title:"Geoffrey Mureithi - Full Stack Developer",author:"Geoffrey Mureithi"}},markdownRemark:{id:"/home/mureithi/projects/my-site/src/posts/the-python-f__k-it-approach.md absPath of file >>> MarkdownRemark",html:'<h1>Python: The F#%K It Approach</h1>\n<blockquote>\n<p>This Article Talks about the <a href="https://github.com/ajalt/fuckitpy">Python Fuckit Module</a> on Github</p>\n</blockquote>\n<p>You can also check out our article on the <a href="http://www.geoffreymureithi.me.ke/2015/06/12/python-when-you-fail-retrying/">Python Retry Module</a> which allows you to deal with retrying in a better way</p>\n<p>Once in a while as a programmer you meet difficult times, be it time-limits, shitty code and much more. It is not advisable to suppress errors. Every programmer should be handle Exceptions. But what do you do in these times where it proves difficult to approach things the expected war. ?</p>\n<ol>\n<li>\n<p>Handling problematic imports:  </p>\n<p>Import Module</p>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code><span class="token keyword">import</span> fuckit\n<span class="token comment">#import problematic_module</span>\nfuckit<span class="token punctuation">(</span><span class="token string">\'problematic_module\'</span><span class="token punctuation">)</span>\nproblematic_module<span class="token punctuation">.</span>a_function<span class="token punctuation">(</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p>Class with Errors:(as a @decorator)</p>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code>@fuckit\n<span class="token keyword">class</span> <span class="token class-name">Person</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">:</span>\n AnotherName <span class="token operator">=</span> <span class="token string">\'Sue Ann\'</span>\n <span class="token keyword">def</span> <span class="token function">__init__</span><span class="token punctuation">(</span>self<span class="token punctuation">)</span><span class="token punctuation">:</span>\n self<span class="token punctuation">.</span>FirstName <span class="token operator">=</span> <span class="token string">\'Tom\'</span>\n self<span class="token punctuation">.</span>LastName <span class="token operator">=</span> <span class="token string">\'Sneed\'</span>\n <span class="token keyword">def</span> <span class="token function">get_name</span><span class="token punctuation">(</span>self<span class="token punctuation">)</span><span class="token punctuation">:</span>\n <span class="token keyword">return</span> self<span class="token punctuation">.</span>FirstName <span class="token operator">+</span> <span class="token string">\' \'</span> <span class="token operator">+</span> self<span class="token punctuation">.</span>LastName\n@fuckit\n<span class="token keyword">class</span> <span class="token class-name">Employee</span><span class="token punctuation">(</span>Person<span class="token punctuation">)</span><span class="token punctuation">:</span>\n <span class="token keyword">def</span> <span class="token function">__init__</span><span class="token punctuation">(</span>self<span class="token punctuation">)</span><span class="token punctuation">:</span>\n self<span class="token punctuation">.</span>empnum <span class="token operator">=</span> <span class="token string">\'abc123\'</span>\n <span class="token keyword">def</span> <span class="token function">get_emp</span><span class="token punctuation">(</span>self<span class="token punctuation">)</span><span class="token punctuation">:</span>\n <span class="token keyword">print</span> self<span class="token punctuation">.</span>AnotherName\n <span class="token keyword">return</span> self<span class="token punctuation">.</span>FirstName <span class="token operator">+</span> <span class="token string">\' \'</span> <span class="token operator">+</span> <span class="token string">\'abc\'</span>\n<span class="token comment">#The lines below work just fine</span>\nx <span class="token operator">=</span> Person<span class="token punctuation">(</span><span class="token punctuation">)</span>\ny <span class="token operator">=</span> Employee<span class="token punctuation">(</span><span class="token punctuation">)</span>\n<span class="token keyword">print</span> <span class="token string">\'start\'</span>\n<span class="token keyword">print</span> x<span class="token punctuation">.</span>get_name<span class="token punctuation">(</span><span class="token punctuation">)</span>\n<span class="token keyword">print</span> y<span class="token punctuation">.</span>get_emp<span class="token punctuation">(</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n</li>\n</ol>\n<ol start="3">\n<li>\n<p>Function with errors:(as a @decorator)  </p>\n<p>Function</p>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code>@fuckit\n<span class="token keyword">def</span> <span class="token function">printme</span><span class="token punctuation">(</span> <span class="token builtin">str</span> <span class="token punctuation">)</span><span class="token punctuation">:</span>\n something_wrong\n<span class="token comment"># No Exception</span>\nprintme<span class="token punctuation">(</span><span class="token string">"My string"</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p>Using it in a ‘with’ situation:  </p>\n<p>In a with situation</p>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code><span class="token keyword">def</span> <span class="token function">printme</span><span class="token punctuation">(</span> <span class="token builtin">str</span> <span class="token punctuation">)</span><span class="token punctuation">:</span>\n <span class="token keyword">print</span> <span class="token builtin">str</span>\n<span class="token keyword">with</span> fuckit<span class="token punctuation">:</span>\n printme<span class="token punctuation">(</span><span class="token string">"It will never be an error"</span><span class="token punctuation">)</span>\n<span class="token comment">#Similar to</span>\n<span class="token keyword">try</span><span class="token punctuation">:</span>\n printme<span class="token punctuation">(</span><span class="token string">"It will never be an error"</span><span class="token punctuation">)</span>\n<span class="token keyword">except</span> Exception<span class="token punctuation">:</span>\n <span class="token keyword">pass</span>\n</code></pre>\n      </div>\n</li>\n</ol>\n<p>Keep in mind that the decorator form of fuckit can’t stop syntax errors</p>\n<p>Go on to Github and view the module<a href="https://github.com/ajalt/fuckitpy"> https://github.com/ajalt/fuckitpy</a> or run <code>pip install fuckit</code></p>',frontmatter:{title:"Python: The F#%K It Approach",date:"June 24, 2016",path:"/2016/06/24/python-the-f__k-it-approach/",description:"Once in a while as a programmer you meet difficult times, be it time-limits, shitty code and much more.",image:{childImageSharp:{sizes:{base64:"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAAGCAYAAADDl76dAAAACXBIWXMAAAsSAAALEgHS3X78AAAAhElEQVQY06WOSxLCIBQEOYZSoZSfkIRnQMBPmY3l/c80RhdZW2Ex1bueZnvBIZWAtR2k5jgcOTqx2zymnAaVCbEY9KNGP2g4rzaPueBxm+94vZ9I1SBEhXNWP9JlYVLLiflfaPxXEjAE11S2Cu1JItcJpdJa1lSoRweaH0iZUK8RRG2lH3CcrMlSSwikAAAAAElFTkSuQmCC",aspectRatio:3.111111111111111,src:"/static/python-fuck-it-81546c82a5049b269d4353e80650821d-d24de.jpg",srcSet:"/static/python-fuck-it-81546c82a5049b269d4353e80650821d-bb9c4.jpg 230w,\n/static/python-fuck-it-81546c82a5049b269d4353e80650821d-06753.jpg 460w,\n/static/python-fuck-it-81546c82a5049b269d4353e80650821d-d24de.jpg 896w",sizes:"(max-width: 896px) 100vw, 896px"}}}}}},pathContext:{path:"/2016/06/24/python-the-f__k-it-approach/"}}}});
